import React, { Component } from 'react';

const heading = (props) => 
{ 
        return (
            <div className="col-md-12">
                <div className="col-md-3"><span>{props.heading}</span></div>
                <div className="col-md-9"><p className={props.class}>{props.title}</p></div>
            </div>
        );

}

export default heading;
